CREATE DEFINER=`root`@`localhost` PROCEDURE `ViewReservation`()
BEGIN
SELECT r.Id,
    CONCAT_WS(' ', 
        u.Fname, 
        IFNULL(NULLIF(CONCAT(SUBSTR(u.Mname, 1, 1), '.'), '.'), ''), 
        u.Lname, 
        IFNULL(NULLIF(u.Ext, ''), '')
    ) AS Fullname, 

    r.Date, 
    r.PickupDate, 
    g.Type, 
    g.Photo, 
    g.Name, 
    g.Color, 
    g.Size,
    g.PaymentMethod,
    g.Fee
FROM reservation r
INNER JOIN users u ON r.UserId = u.Id
INNER JOIN gowns g ON r.GownId = g.Id;
END ;;
